import { render } from '@testing-library/react';
import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    let leagueAverages = require('../src/LeagueAvg.json')

    return (
      <div>
        <p>
        {leagueAverages.filter(leagueAverages => leagueAverages.league == 'MLB').map((leagueAverages) => (
          <p>{leagueAverages.league} / {leagueAverages.split}</p>
        ))}
        </p>
        <p>
        {leagueAverages.filter(leagueAverages => leagueAverages.league == 'AAA').map((leagueAverages) => (
          <p>{leagueAverages.league} / {leagueAverages.split}</p>
        ))}
        </p>        
      </div>
    )
  }
}

export default App;
